import Home from "./pages/Home";
import Profile from "./pages/Profile";
import SignIn from "./pages/SignIn";
import SignUp from "./pages/SignUp";
import ForgotPassword from "./pages/ForgotPassword";



function App() {
  return (
   <>
    <Router>
      <Routes>
        <Route path='/' element = {<Home/>} />
      </Routes>
   </Router>
   </>
  );
}

export default App;
